part of 'android_device_details.dart';

AndroidDeviceDetails _$AndroidDeviceDetailsFromJson(
        Map<String, dynamic> json) =>
    AndroidDeviceDetails(
      json['securityPatch'] as String,
      json['sdkInt'] as String,
      json['release'] as String,
      json['previewSdkInt'] as String,
      json['incremental'] as String,
      json['codename'] as String,
      json['baseOS'] as String,
      json['board'] as String,
      json['bootloader'] as String,
      json['brand'] as String,
      json['device'] as String,
      json['display'] as String,
      json['fingerprint'] as String,
      json['hardware'] as String,
      json['host'] as String,
      json['id'] as String,
      json['manufacturer'] as String,
      json['model'] as String,
      json['product'] as String,
      json['supported32BitAbis'] as String,
      json['supported64BitAbis'] as String,
      json['supportedAbis'] as String,
      json['tags'] as String,
      json['type'] as String,
      json['isPhysicalDevice'] as String,
      json['androidId'] as String,
      json['systemFeatures'] as String,
    );

Map<String, dynamic> _$AndroidDeviceDetailsToJson(
        AndroidDeviceDetails instance) =>
    <String, dynamic>{
      'securityPatch': instance.securityPatch,
      'sdkInt': instance.sdkInt,
      'release': instance.release,
      'previewSdkInt': instance.previewSdkInt,
      'incremental': instance.incremental,
      'codename': instance.codename,
      'baseOS': instance.baseOS,
      'board': instance.board,
      'bootloader': instance.bootloader,
      'brand': instance.brand,
      'device': instance.device,
      'display': instance.display,
      'fingerprint': instance.fingerprint,
      'hardware': instance.hardware,
      'host': instance.host,
      'id': instance.id,
      'manufacturer': instance.manufacturer,
      'model': instance.model,
      'product': instance.product,
      'supported32BitAbis': instance.supported32BitAbis,
      'supported64BitAbis': instance.supported64BitAbis,
      'supportedAbis': instance.supportedAbis,
      'tags': instance.tags,
      'type': instance.type,
      'isPhysicalDevice': instance.isPhysicalDevice,
      'androidId': instance.androidId,
      'systemFeatures': instance.systemFeatures,
    };
